import { Box, Toolbar } from "@mui/material";

const Footer = () => {
  return (
    <Box>
      <Toolbar className="flex bg-[#ff0]">
        <div style={{flex: 5}} className="bg-[#f00]">hammad</div>
        <div style={{flex: 3}} className="bg-[#0f0]">hammad</div>
        <div style={{flex: 4}} className="bg-[#00f]">hammad</div>
      </Toolbar>
      <Toolbar>
        <div>hammad</div>
        <div>hammad</div>
      </Toolbar>
    </Box>
  );
};

export default Footer;
